After years of decline, the Roman Empire is desperate to recapture its past. Amidst war and political confusion, Urbina Prima schemes to make her son, Cassius, the next emperor. The only thing standing in their way is Maximus, a once great Roman commander with his own dreams of nobility. Can Rome reclaim its glory, or will the chaos lead to civil war?

Directors: David Kocar, Petr Kubik
Writers: Christopher Hyde, Lloyd Simandl (creator)
Stars: Tom McKay, Michelle Lukes, Brian Caspe
Genres: Action,Adventure,History
Country: Czech Republic,Canada
Language: English


